import React, { useEffect, useState } from "react";
import { Formik, Form } from "formik";
import * as Yup from "yup";
import CustomTextInput from "./FormComponents/CustomTextInput";
import CountrySelect from "./FormComponents/CountrySelect";
import { Styles } from "../../Styles";

const phoneRegExp = /^((\\+[1-9]{1,4}[ \\-]*)|(\\([0-9]{2,3}\\)[ \\-]*)|([0-9]{2,4})[ \\-]*)*?[0-9]{3,4}?[ \\-]*[0-9]{3,4}?$/;

export default class SubmittedForm extends React.Component {
  constructor(props) {
    super(props);
  }
  state = {};

  async componentDidMount() {}

  render() {
    return (
      <Styles>
        <div>
          <h1>Thank you for your submission!</h1>
          <h3>First Name</h3>
          <p>{this.props.submittedValues.firstName}</p>
          <br />
          <h3>Middle Name</h3>
          <p>{this.props.submittedValues.middleName}</p>
          <br />
          <h3>Last Name</h3>
          <p>{this.props.submittedValues.lastName}</p>
          <br />
          <h3>Country</h3>
          <p>{this.props.submittedValues.country}</p>
          <br />
          <h3>Phone Number</h3>
          <p>{this.props.submittedValues.phoneNumber}</p>
          <br />
          <h3>Email</h3>
          <p>{this.props.submittedValues.email}</p>
          <br />
          <h3>Favorite Color</h3>
          <p>{this.props.submittedValues.favoriteColor}</p>
          <br />
          <h3>Comments</h3>
          <p>{this.props.submittedValues.comments}</p>
          <br />
          <p>Something look wrong?</p>
          <button type="submit" onClick={() => this.props.returnToEdit()}>
            Edit Reponses
          </button>
        </div>
      </Styles>
    );
  }
}
